import React from "react";
import "./practice.css";
import { Link } from "react-router-dom";

const Home = () => {
  return (
    <div>
      <div className="background">
        <div className="slogan">
          There is <span>HOPE</span>
          <br />& There is <span>LIFE</span>
          <br />
          Through the word of <span>GOD</span>
        </div>
      </div>
    </div>
  );
};

export default Home;
